import { Divider } from './skl-ds-divider';


export default {
  title: 'Example/Atoms/skl-ds-divider',
  component: Divider,
  argTypes: {
    color: {
      control: 'color',
      description: 'Colore del divider',
    },
    thickness: {
      control: 'text',
      description: 'Spessore del divider (es. "2px", "0.5rem")',
    }
  },
};

const Template = (args) => <Divider {...args} />;

export const Horizontal = {
  args: {
  color: '#ccc',
  thickness: '1px'
  }
}



export const Small = {
  args: {
    iconName: 'alarm', 
    color: '#000', 
    size: 'small'
  }
}
